"""Importing Libraries"""

import numpy as np
import pandas as pd

"""Select Database"""

def get_df(BD_PARADAS, location):
  worksheet = gc.open(BD_PARADAS).get_worksheet(location)
  rows = worksheet.get_all_values()
  head = rows[0]
  data = rows[1:]
  df = pd.DataFrame.from_records(data, columns=head)
  return df

"""Check the Database"""

