"""##Database Treatment

Formating Column 'TOTAL_PARADAS' from *string* into *float*
"""

df['TOTAL_PARADAS'] = df['TOTAL_PARADAS'].astype(float)

"""Function: Time Period Selection"""

def filter_data(df, field_1, start_date, end_date, field_2, area_name, field_3, cause_1, cause_2):
  results = pd.DataFrame({})

  #Check the data range
  #Check the area
  #Check the reasons
  selected_area = df[(df[field_1] >= start_date) & (df[field_1] <= end_date) & (df[field_2] == area_name) & ((df[field_3] == cause_1) | (df[field_3] == cause_2))]
  results = pd.concat([results, selected_area])
  
  return results

