"""Function: Choosing a TAG in the Selected Area"""

def filter_column(df, field_1,selected_tag):
  results = pd.DataFrame({})

  #Check the TAG
  selected_area = df[(df[field_1] == selected_tag)]
  results = pd.concat([results, selected_area])
  
  return results

"""Current Dataframe by TAG"""

df_3 = filter_column(df_filter_2,'TAG_EQUIP','TP-0016')
df_3

"""Donwtime Counter by Component & Problem


"""

df_4 = df_3.groupby(['MOTIVO','DESC_COMPONE','DESC_PROBLEMA']).agg({'TOTAL_PARADAS': 'sum','NUM_PARADAS': 'sum'})
df_4

"""Statistic Description of Dataframe"""

df_4.describe(include='all')

df_4.sum()

"""##Reliability

New Column: Time Working

$Time.Working(hours) = 1.Year(hours) - Downtime.Year(hours)$
"""

df_4['TEMP_FUNCIONANDO'] = ((365.2425*24) - (df_4['TOTAL_PARADAS']))
df_4

"""New Column: Mean Time Between Failures

$MTBF = \frac{Time.Working}{Downtime.Counter}$
"""

df_4['MTBF'] = df_4['TEMP_FUNCIONANDO']/df_4['NUM_PARADAS']
df_4

"""New Column: Failure Rate

$\lambda = \frac{1}{MTBF}$
"""

df_4['lambda'] = 1/df_4['MTBF']
df_4

"""New Column: Realiability

$R(t) = e^{-\lambda.t}$
"""

t = 30 #Time in Days

df_4['CONFIABILIDADE'] = np.exp(-df_4['lambda']*t)

df_4

"""Realiability by Component"""

df_5 = df_4.groupby(['DESC_COMPONE']).agg({'CONFIABILIDADE': 'prod'})
df_5

"""Realiability by Problem Nature: Eletric or Mechanical"""

df_6 = df_4.groupby(['MOTIVO']).agg({'CONFIABILIDADE': 'prod'})
df_6

"""Realiability of Selected TAG"""

df_6 = df_4.agg({'CONFIABILIDADE': 'prod'})
df_6